import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes } from 'react-router-dom';
import Login from './Pages/Login';
import Signup from './Pages/Signup';
import Homepage from './Pages/Homepage';
import Modifybook from './Pages/Modifybook';
import Addbook from './Pages/Addbook';

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Routes path="/" element={<Login />}/>
      <Routes path="/Login" element={<Login />}/>
      <Routes path="/Signup" element={<Signup />}/>
      <Routes path="/Homepage" element={<Homepage />}/>
      <Routes path="/Modidybook" element={<Modifybook />}/>
      <Routes path="/Addbook" element={<Addbook />}/>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
